INSERT INTO flora VALUES('GpdNNj','0d2QNN','2023-05-20 20:23:21','Cat Girl','Felis Sapien','While the origin of this species is still under research, Felis Sapien- known commonly as "Cat Girls"- are humanoid creatures with cat-like features and abilities. Known for their large cat ears, slit pupils, and sharp nails, cat girls are quick and agile, though easily distracted.','Anything both humans and cats are able to digest with the exception of milk. Milk, cat food, meat, etc.','They can no longer survive in the wild as they pertain of mostly human features and have adapted to live with other humans.','Piney','@PineySOP on twitter','','','','stillworkingontheimagewillupdate.com','');
