INSERT INTO flora VALUES('gq0KxJ','PpMLL0','2023-05-21 21:41:08','Wizards (sentient branch)','Wizardfolk',replace('Hailing from a distant, tiny planet in the Andromeda galaxy, Wizardfolk have started to explore the galaxy to seek out new forms of "magic". Unfortunately for them, the "magic" in the way that they understand it can only exist on their own planet. \n\nBecause wizards are built entirely out of the substance they call "magic,"their size can range from a few molecules to planets. They usually prefer the 1cm to 2metre range. \n\nWizardfolk will commonly pick a singular topic to study on their assigned planet, such as a species or language, and dress in accordance to it. The only real requirement in Wizardfolk attire and form culturally is their distinctive pointed hat. ','\n',char(10)),'Any small living matter, preferably still alive by the time they get to it.','Wizards (folk or otherwise) are extremophiles, but prefer areas teeming with life such as rainforests or petri dishes.','flapuflapu','https://flapuflapu.carrd.co/','https://storage.tally.so/private/wizard-on-the-coast.jpg?id=b5d6Ve&accessToken=eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6ImI1ZDZWZSIsImZvcm1JZCI6IjNxYVZOOCIsImlhdCI6MTc0MzQ2MjE1M30.cFoNVvtt5jJNGM_UnrfyxU4r-tc8FPBQZObOCysTZVU&signature=16857851ffbb7662ebe351b2e216081ae7c7e1323b00155b55fddf546d3ca58d','','','','');
