INSERT INTO flora VALUES('RoYPLd','NDqdjl','2023-05-25 2:22:13','Ghouls','Ghouls',replace('These are social animals which rarely live alone. They are mostly quadrupedal but they are capable of standing upright for a short period of time. They are omnivorous, although they mostly eat meat. When threatened or quarreling, they will pull their lips back, revealing much of their teeth and gums. One''s acceptability and position in their pack is very important - constant aggression or a physical anomaly may cause a ghoul to be ostracized.\n','\n',char(10)),'smaller animals, humans','everywhere','ANGELMORNINGSTAR','https://angelmorningstar.net/','','','','https://angelmorningstar.net/gallery/ghoul.jpeg','');
